import React from "react";
const JobCard = () => {
    return (
            <div className="CompanyDetail card text-center">
                <div className="CompanyDetail card-body">
                <h5 className="CompanyDetail card-title">Available Roles</h5>
                <p className="CompanyDetail card-text">Jobs.name</p>
                </div>
            </div>
            )
};
export default JobCard;
